window.bookSummaryJSON = "<p>Book one of The Uncommon Series, the best-selling tech start-up thriller trilogy. </p> <p>Mara Winkel is rock climbing, mountain biking, and 'studying' her way through school at the University of Colorado, Boulder. </p> <p>But when her best friend, James, asks her to partner with him to start a disruptive new software company, she discovers that the world of technology start-ups is fraught with intrigue, adrenaline, soaring successes, and scorching failures. It turns out this is especially true when your technology threatens entrenched drug cartels. </p> <p>Mara has to juggle mysterious investors, opaque partners, critical customers, and a team that is as brilliant as it is dysfunctional until only one choice remains: win or die. </p>"; 
